import reportWebVitals from './reportWebVitals';

function Templvl () {
  const [temp, setTemp] = useState(0);

return (
  <>
  <div className='frame'>
  <h1 className='display'>{temp}</h1>
  <div className='btns'>
    <button onClick={() => setTemp((c) => c + 1 )}>+</button>
    <button onClick={() => setTemp((c) => c - 1 )}>-</button>
  </div>

  </div>
  </>
)
}


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <Templvl />
